import React from 'react';
import Cart from './Cart';

const Order = (props) => {
  const { totalPrice } = props.location.state || {};

  return (
    <div>
      <h2>Total Price of Ordered Items</h2>
      <p>Total Price: ${totalPrice}</p>
    </div>
  );
};


export default Order;
